import React, { Component } from 'react';
import {
    Text,
    View,
    Image
} from 'react-native';



class ListItem extends Component {
    state = {
        clear: 'data:image/png;base64,',
        snow: 'data:image/png;base64,',
        rain: 'data:image/png;base64,',
        clouds: 'data:image/png;base64,',
        uri: ''
    }
    componentWillMount() {
        this._chooseImage();
    }

    _chooseImage() {
        this.props.item.weather.main === "Rain" ?
            this.setState({ uri: this.state.rain })
            : this.props.weather.main === 'Clouds' ?
                this.setState({ uri: this.state.clouds })
                : this.props.weather.main === 'Snow' ?
                    this.setState({ uri: this.state.snow })
                    : this.props.weather.main === 'Clear' ?
                        this.setState({ uri: this.state.clear }):''
    }

    render() {
        return (
            <View>
                <Text>{this.props.date}</Text>
                <View>
                    <Text>{this.props.item.deg}</Text>
                    <Image source={{uri: this.state.uri}} />
                </View>
            </View>
        );
    }
}

export default ListItem;